.cdn-overall
{
    display:flex;
    justify-content:center;
    align-items:center;
    flex-direction:column;
    background-color:#0f0f0f;
    min-height:70vh;
    padding-bottom:100px;

}


.cdn-details-wrapper
{
background-color:#0f0f0f;
padding:0px 0px;
padding-top:50px;
padding-bottom:70px;
display:flex;
align-items:center;
flex-direction:column;
color:#fff;
}
.highlights
{
    color:#0059ff;
    font-size:12px;
    margin:0px;
}
.cdn-details-wrapper h2
{
    font-size:3em;
    line-height:1;
    padding-bottom:0px;
     margin-bottom:0px;
     margin-top:30px;
}
.cdn-details-wrapper p
{
    text-align:center;
    max-width:600px;

}
.cdn-benefits
{
    display:flex;
    flex-direction:row;
    justify-content:flex-start;
    align-items:center;
    color:#fff;
  max-width:600px;
  margin-bottom:50px;

}
.cdn-benefits-icon
{
border-right:#fff dashed 1px;
padding-right:30px;
margin-right:30px;
}
.cdn-benefits-icon img
{
width:80px;
}
.cdn-benefits h6
{
    font-size:18px;
    margin-bottom:0px;
    margin-top:0px;
}

.rotate-round
{
    animation: rotation360 infinite 2000s;
    transform:rotate(0turn);
}

@keyframes rotation360
{
    0%{transform:rotate(360turn)}
    100%{transform:rotate(0turn)}
}
